import React from "react";
import logo from "/home/zprogrammercode/jb_moving/src/Assets/images/Jacobs Brothers Moving asnd storage.png";

export default function Header() {
  <div>
    <a alt="logo" href="/#">
      {logo}
    </a>
    <nav role="navigation">
      <ul>
        <li>About Us</li>
        <li>Login</li>
        <li>Packing</li>
        <li>Moving</li>
        <li>Contact Us</li>
      </ul>
    </nav>
  </div>;
}
